import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className='navbar-container d-flex-jsb'>
      <div className='navbar-logo-container'>
        <span>Life Beyond</span>
      </div>
      <div className='navbar-body-container'>
        <Link to='/home'>Home</Link>
        <Link to='/doctor'>Doctor</Link>
        <Link to='/lawyer'>Lawyer</Link>
        <Link to='/succes-stoires'>Success Stories</Link>
      </div>
      <div className='navbar-footer-container'></div>
    </div>
  );
};

export default Navbar;
